import React from "react";
import Section2Image from "./Images/2.jpg";

const Home = () => (
  <div className="App-header"
    style={{  
      backgroundImage: `url(${Section2Image})`,
      backgroundPosition: 'center',
      backgroundSize: 'cover',
      backgroundRepeat: 'no-repeat'
    }}
  >
  </div>
);

export default Home;
